import React from 'react';

export default (props) => {
  return (
    <div class='card'>
      <div class='card-header'>
        {props}
      </div>
      <div class='card-body'>
        <h5 class='card-title'>{}</h5>
        <p class='card-text'>{}</p>
        <a href='#' class='btn btn-primary'>Go somewhere</a>
      </div>
    </div>
  );
}
;
